import React from 'react';
import Header from '../components/Header';

const AboutPage = () => {
  return (
    <div>
      <Header />
      <section style={{ padding: '4rem 2rem', textAlign: 'center', minHeight: '60vh' }}>
        <h1 style={{ fontSize: '3rem', marginBottom: '2rem' }}>About Us</h1>
        <p style={{ fontSize: '1.2rem', lineHeight: '1.6', maxWidth: '600px', margin: '0 auto' }}>
          We are a creative team dedicated to providing the best services and solutions for our customers.
        </p>
      </section>
    </div>
  );
};

export default AboutPage;
